                            trigger: type,
                            constants: _package.Meta.GroupConstants,
                            skipHeader: false));
                    return TryGet<int?>.Succeed((int)CellBlock_FieldIndex.Items);
                }
                default:
                    return TryGet<int?>.Succeed(null);
            }
        }
    }

